import React, {useState, useEffect} from "react";
import {connect} from "react-redux";
import {authenticate} from "../redux/authActions";
import Layout from "../components/Layout";
import {useRouter}from "next/router";

const SignIn = ({authenticate, token}) => {
    const [inputs, setInputs] = useState({email: "bojan@hotmail.com", password: "sauron1985"});
    const router = useRouter();

    const handleSubmit = event => {
        event.preventDefault();
        authenticate({email: "bojan@gmail.com", password: "sauron1985"});
    }

    if(token){
      router.push("/")
    }

    return(
        <Layout title="Sign In">
            <h3>Sign In</h3>
            <form onSubmit={handleSubmit}>
                <div>
                    <input
                        type="email"
                        placeholder="Email"
                        required
                        value={inputs.email}
                        onChange={e => setEmail(e.target.value)}
                    />
                </div>
                <div>
                    <input
                        className="input"
                        type="password"
                        placeholder="Password"
                        required
                        value={inputs.password}
                        onChange={e => setPassword(e.target.value)}
                    />
                </div>
                <div>
                    <button type="submit">Sign In</button>
                </div>
            </form>
        </Layout>
    )
}

const mapStateToProps = ({authentication}) => {
    return{
        token: authentication.token
    }
}

export default connect(mapStateToProps, {authenticate})(SignIn);
